import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Signup from './pages/Signup.js';
import { AuthenticationContext } from './AuthenticationContext';
import { useContext } from 'react'; 

function App() {
  const { setUserAndAuthenticate } = useContext(AuthenticationContext);

  return (
    <Router>
      <Routes> 
        <Route 
          path="/signup" 
          element={<Signup setUserAndAuthenticate={setUserAndAuthenticate} />} // Pass setUserAndAuthenticate as prop
        /> 
      </Routes>
    </Router>
  );
}

export default App;
